import React, { useEffect, useState } from 'react';
import { Button, Card, Spin, message, Menu } from 'antd';
import 'antd/dist/reset.css';
import { BrowserRouter as Router, Routes, Route, Link, useLocation } from 'react-router-dom';
import { getUserInfo, UserInfo } from './api/user';
import History from './pages/History';
import ExecuteRecords from './pages/ExecuteRecords';

const Home: React.FC = () => {
  const [user, setUser] = useState<UserInfo | null>(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    getUserInfo()
      .then(data => {
        setUser(data);
        setLoading(false);
      })
      .catch(() => {
        message.error('获取用户信息失败');
        setLoading(false);
      });
  }, []);

  return (
    <div style={{ padding: 24 }}>
      {/* <h1>React + Ant Design Starter</h1>
      <Card title="用户信息" style={{ maxWidth: 400 }}>
        {loading ? (
          <Spin />
        ) : user ? (
          <pre>{JSON.stringify(user, null, 2)}</pre>
        ) : (
          <span>暂无数据</span>
        )}
      </Card>
      <Button type="primary" style={{ marginTop: 24 }}>
        Antd 按钮
      </Button> */}
      <Route path="/execute-records" element={<ExecuteRecords />} />

    </div>
  );
};

const App: React.FC = () => {
  const location = useLocation();

  return (
    <>
      <Menu mode="horizontal" selectedKeys={[location.pathname]}>
        <Menu.Item key="/">
          <Link to="/">主页</Link>
        </Menu.Item>
        <Menu.Item key="/history">
          <Link to="/history">历史记录</Link>
        </Menu.Item>
      </Menu>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/history" element={<History />} />
      </Routes>
    </>
  );
};

const AppWithRouter: React.FC = () => (
  <Router>
    <App />
  </Router>
);

export default AppWithRouter;
